def solution(stdin: str) -> str:
    """
    The algorithm is the following:

    If n is odd, then answer is -1
    Otherwise we have that n = a_1 + a_2 + a_3 +... + a_{n / 2}

    If a_i is even, then n = a_i + a_{i + 1} +... + a_{n / 2}

    If n is even, we get that n = a_i + a_{i + 1} +... + a_{n - 1}

    The greatest common divisor of a number and its inverse is the same number.
    In other words, if a_i is even, then we have:
    a_i = 2 * a_{i + 1} = 2 * (a_i + 1) = (a_i + 1) * 2 = 2 * (a_i + 1) - a_i = 2 * (a_i + 1) - a_i

    If n is odd, we can deduce that n = 2 * a_1 + a_2 + a_3 +... + a_{n / 2}

    However, the solution is only exist for n = 2 * a_i + a_{i + 1} +... + a_{n / 2} + 1

    Therefore, we can deduce that n must be even, so n is of course 2 * a_i + a_{i + 1} +... + a_{n / 2} + 1.
    """

    n, k = tuple(map(int, stdin.split()))

    if n == 1:
        return -1

    ans = 0

    for i in range(k):
        if i == 0:
            if n % 2 == 0:
                ans += 2 * n // 2
        else:
            if n % 2 == 0:
                ans += n // 2
            else:
                ans += n // 2 + 1

    if ans % 2 == 0:
        return ans // 2
    return -1

