    table = [[0 for _ in range(k + 1)] for _ in range(n + 1)]

    # the number of ways to choose n numbers from 1 to i with at most j exclamation marks is:
    #   1, if i <= 1
    #   1, if i == 2 and j == 0
    #   1, if i == 2 and j == 1
    #  ...
    #   1, if i == 1 and j == 0
    #   1, if i == 1 and j == 1
    #   1, if i == 1 and j >= 2
    for i in range(3, n + 1):
