def solution(stdin: str) -> str:

    puzzle_matrix = [list(line.strip()) for line in stdin.strip().split("\n")]

    def get_empty_positions(puzzle_matrix: list) -> list:
        """
        Returns a list of tuples (x, y)
        """
        return [(x, y) for y in range(len(puzzle_matrix)) for x in range(len(puzzle_matrix[0])) if puzzle_matrix[y][x] == 'X']

    def is_valid_puzzle(puzzle_matrix: list) -> bool:
        """
        Returns True if the puzzle is a valid one and False otherwise
        """
        rows, cols = len(puzzle_matrix), len(puzzle_matrix[0])

        def is_valid_tile(tile: str, x: int, y: int) -> bool:
            """
            Returns True if the tile is valid and False otherwise
            """
            return tile == puzzle_matrix[y][x] and 0 <= x < cols and 0 <= y < rows

        def is_valid_move(x1: int, y1: int, x2: int, y2: int) -> bool:
            return is_valid_tile(puzzle_matrix[y2][x2], x2, y2) and is_valid_tile(puzzle_matrix[y1][x1], x1, y1)

        for y in range(rows):
            for x in range(cols):
                if puzzle_matrix[y][x]!= 'X':
                    if not is_valid_move(x, y, x, y - 1):
                        return False
                    if not is_valid_move(x, y, x + 1, y):
                        return False
                    if not is_valid_move(x, y, x, y + 1):
                        return False
                    if not is_valid_move(x, y, x - 1, y):
                        return False
        return True

    bessie_puzzle_empty_positions = get_empty_positions(puzzle_matrix)
    elsie_puzzle_empty_positions = get_empty_positions(list(zip(*reversed(puzzle_matrix))))

    if is_valid_puzzle(puzzle_matrix):
        if bessie_puzzle_empty_positions == elsie_puzzle_empty_positions:
            return "YES"
    return "NO"

