                        queue.append((nx + dx, ny + dy))
                    elif board[nx + dx][ny + dy] == board[sx][sy]:
                        return 1 + knight_distance(board, nx + dx, ny + dy, N)

        return 2

    for i in range(N):
        for j in range(N):
            if board[i][j] == 1:
                sx, sy = i, j
    return str(knight_distance(board, sx, sy, N)) +'' + str(knight_distance(board, sx, sy, N) - 1)

