def solution(stdin: str) -> str:
    def get_input():
        n = stdin.readline().strip()
        return stdin.readline().strip().split()

    def check(arr: list, s: int, t: int) -> bool:
        # s is the position of the element before the number to be moved
        # t is the position of the element after the number to be moved
        return s + arr[s] == t + arr[t] and s!= t

    def move(arr: list, s: int, t: int) -> None:
        # Move the element at index s to index t
        arr[s], arr[t] = arr[t], arr[s]

    def divide(arr: list, s: int, t: int) -> str:
        if arr[s] == 0:
            return 'NO'
        if s == t:
            return 'NO'
        if s + arr[s] == t + arr[t]:
            return 'YES'
        while s + arr[s] < t + arr[t]:
            s += 1
        return 'YES' if s == t else 'NO'

    def solve(arr: list, i: int) -> str:
        if i == 0:
            return 'NO'
        if i == 1:
            return 'YES'
        move(arr, i, i - 1)
        result = divide(arr, i - 1, i)
        if result == 'NO':
            return 'NO'
        move(arr, i, i - 1)
        return result

    def main():
        arr = get_input()
        n = len(arr)
        for i in range(n):
            print(solve(arr, i))
    if __name__ == "__main__":
        main()


