def solution(stdin: str) -> str:
    board = [[0 for _ in range(8)] for _ in range(8)]
    for i, c in enumerate(stdin):
        if c == 'X':
            board[i // 8][i % 8] = 1

    def get_adjacent(x, y):
        if x > 0:
            yield (x - 1, y)
        if x < 7:
            yield (x + 1, y)
        if y > 0:
            yield (x, y - 1)
        if y < 7:
            yield (x, y + 1)

    def adjacent(x, y):
        return 0 <= x < 8 and 0 <= y < 8

    def bishwock_in(x, y):
        return board[x][y] == 1

    def bishwock_out(x, y):
        return board[x][y] == 0

    def find_bishwock(board, x, y):
        if bishwock_in(x, y):
            return 0

        visited = set()
        q = deque([(x, y)])

        while q:
            x, y = q.popleft()

            for i, j in get_adjacent(x, y):
                if adjacent(i, j) and not (i, j) in visited and not bishwock_in(i, j):
                    visited.add((i, j))
                    q.append((i, j))

        return len(visited)

    def bishwock_place(board, x, y, n):
        if board[x][y] == 1:
            return 0

        board[x][y] = 1

        visited = set()
        q = deque([(x, y)])

        while q:
            x, y = q.popleft()

            for i, j in get_adjacent(x, y):
                if adjacent(i, j) and not (i, j) in visited and not bishwock_in(i, j):
                    visited.add((i, j))
                    q.append((i, j))

        for i, j in get_adjacent(x, y):
            if bishwock_in(i, j):
                bishwock_place(board, i, j, n + 1)

    bishwock_place(board, 0, 0, 0)
    return str(find_bishwock(board, 0, 0))

