def solution(stdin: str) -> str:
    n = int(stdin)
    # check for invalid input
    if n < 2 or n > 10 ** 18:
        return '0'
    # list of all pairs that can be played
    pairs = []
    # max number of games in which winner can take part
    max_games = 0
    for player in range(1, n):
        if player == 1:
            # player 1 can't play with any other player, hence max_games = 1
            max_games = 1
            continue
        # player 2, 3, 4...
        for opponent in range(1, player):
            # player can't play against player 1, since player 1 has already played 2 games
            if opponent == 1:
                continue
            # check if number of games played differs by at most 1
            if abs(player - opponent) <= 1:
                # add pair (player, opponent) to the pairs list
                pairs.append((player, opponent))
    # iterate over the pairs list and take the max from the list
    for pair in pairs:
        # take max between max_games and number of games played by player
        max_games = max(max_games, abs(pair[0] - pair[1]))
    # return the max number of games in which the winner can take part
    return str(max_games)

