    # The board is read line by line, then each row is evaluated using a stack. If the stack is empty, the current line is empty. Else, we pop the last letter from the stack and, if it matches the current line, we are still at the same row. If the stack is not empty and the last letter on the stack is equal to the current line, we remove the current letter from the stack and push the previous letter on the stack to the current row. If the stack is not empty and the last letter on the stack is not equal to the current line, we push the current letter on the stack to the current row. If the stack is empty, we push the current letter on the stack to the current row.
    def is_row_winner(board: str) -> bool:
