            stack = []
            while col < len(board):
                letter = board[col]
                if not letter:
                    if not stack:
                        return False
                    col += 1
                    stack.pop()
                else:
                    stack.append(letter)
                    col += 1
            return True

        for row in range(len(board)):
            if _is_row_winner(row, 0):
                return True

        return False

    board = stdin.strip()
    return 'A' if is_row_winner(board) else 'B'


