    board = [[] for x in range(N + 1)]
    for i in range(N):
        if game_board[i]:
            board[i].append(i)
            board[i+1].append(i+1)

    ans = []
    for i in range(N, 0, -1):
        if not board[i]:
            continue

        tmp = []
        if game_board[i-1] and not board[i-1]:
            tmp.append(i-1)
        if i-2 > 0 and game_board[i-2] and not board[i-2]:
            tmp.append(i-2)
        if i-3 > 0 and game_board[i-3] and not board[i-3]:
            tmp.append(i-3)

        if not tmp:
            continue

        ans.append(str(min(tmp)))

    return " ".join(ans) if ans else -1

