from collections import deque

class Stack(object):
    def __init__(self):
        self.queue = deque()
    def push(self, elem):
        self.queue.append(elem)
    def pop(self):
        return self.queue.pop()
    def peek(self):
        return self.queue[-1]
    def size(self):
        return len(self.queue)
    def empty(self):
        return len(self.queue) == 0
    def front(self):
        return self.queue[0]
    def back(self):
        return self.queue[-1]

