            second = correct_and_not_correct[j]
            if first[0] == second[0]:
                possible_pairs.append((first[0], first[1], second[2], second[3]))

    # (6) Check if a pair is consistent
    for pair in possible_pairs:
        if pair in correct_combinations:
            continue
        else:
            return 'No'

    return 'Yes'

