        visited[r][c] = 1
        for delta_r, delta_c in [(-1, 0), (0, -1), (1, 0), (0, 1)]:
            next_r, next_c = r + delta_r, c + delta_c
            if 0 <= next_r < r and 0 <= next_c < c and not visited[next_r][next_c] and grid[next_r][next_c] == 'S':
                dfs(next_r, next_c, grid, visited)

    visited = [[0] * c for _ in range(r)]
    max_tiles = 0
    for row in range(r):
        for col in range(c):
            if grid[row][col] == 'S' and not visited[row][col]:
                max_tiles = max(max_tiles, tiles + dfs(row, col, grid, visited))
    return str(max_tiles)

