    def count_vertices(n: int) -> int:
        vertices = 0
        for _ in range(n):
            vertices += 1
        return vertices

    def read_numbers() -> List[int]:
        numbers = []
        for _ in range(count_vertices(n)):
            numbers.append(int(stdin.readline()))
        return numbers

    def read_pair(n: int) -> Tuple[int, int]:
        return tuple(read_numbers())

    def validate_pair(pair: Tuple[int, int]) -> bool:
        if pair[0] == pair[1]:
            return False
        if pair[0] > pair[1]:
            pair = (pair[1], pair[0])
        return True

    def add_length(pair: Tuple[int, int]) -> None:
        a, b = pair
        distance = n - 1 - a - b
        if a > b:
            pair = (a, b)
        else:
            pair = (b, a)
        edges[pair] = edges.get(pair, 0) + distance

    def remove_pair(pair: Tuple[int, int]) -> None:
        a, b = pair
        if a > b:
            pair = (a, b)
        else:
            pair = (b, a)
        edges[pair] = 0

    def print_answer(sequence: List[Tuple[int, int, int]]) -> None:
        print(len(sequence))
        for operation in sequence:
            print(*operation)

    n = int(stdin.readline())
    edges = {}
    for _ in range(n - 1):
        pair = read_pair(n)
        if not validate_pair(pair):
            continue
        add_length(pair)
    sequence = [("1", "1", "0")]
    while True:
        current_vertices = count_vertices(n)
        if current_vertices == 1:
            break
        pair = max(edges, key=edges.get)
        sequence.append(pair)
        remove_pair(pair)
    print_answer(sequence)
